"<!-- Call stack profile: correlates call stack profiling info with\n     program structure. -->\n<!ELEMENT CSPROFILE (CSPROFILEHDR, CSPROFILEPARAMS, CSPROFILETREE)>\n<!ATTLIST CSPROFILE\n       version CDATA #REQUIRED>\n  <!ELEMENT CSPROFILEHDR (#PCDATA)>\n  <!ELEMENT CSPROFILEPARAMS (TARGET, METRIC)>\n    <!ELEMENT TARGET EMPTY>\n    <!ATTLIST TARGET\n         name CDATA #REQUIRED>\n    <!ELEMENT METRIC EMPTY>\n    <!ATTLIST METRIC\n         shortName   CDATA #REQUIRED\n         nativeName  CDATA #REQUIRED\n         period      CDATA #REQUIRED\n         units       CDATA #IMPLIED\n         displayName CDATA #IMPLIED\n         display     (true|false) #IMPLIED>\n  <!ELEMENT CSPROFILETREE (PGM)*>\n    <!-- The program. (cf. PGM dtd) -->\n    <!ELEMENT PGM (G|CALLSITE)+>\n    <!ATTLIST PGM\n	    n CDATA #REQUIRED>\n    <!-- Groups create arbitrary sets of other elements except PGM. -->\n    <!ELEMENT G (G|CALLSITE|L|S)*>\n    <!ATTLIST G\n	    n CDATA #IMPLIED>\n    <!-- Callsite identifies a location in source code (file,\n         procedure, line) that corresponds to a frame in a call stack\n         sample (but multiple PCs can map to one source file line).  A\n         parent CALLSITE is the caller of any children CALLSITEs.  A\n         tree of CALLSITEs represents call stack samples with the tree\n         root representing a common stack bottom and leafs\n         representing the top of stack samples.  Leaves contain counts\n         indicating how many times that call stack was\n         sampled. [FIXME: add load modules] -->\n    <!ELEMENT CALLSITE (G|CALLSITE|L|S)*>\n    <!ATTLIST CALLSITE\n	    f CDATA #IMPLIED\n	    p CDATA #IMPLIED\n	    l CDATA #IMPLIED\n	    c CDATA #IMPLIED>\n    <!-- Loops -->\n    <!ELEMENT L (G|L|S)*>\n    <!ATTLIST L\n	    b CDATA #IMPLIED\n	    e CDATA #IMPLIED>\n    <!-- Statement/Statement range  -->\n    <!ELEMENT S EMPTY>\n    <!ATTLIST S\n	    b CDATA #REQUIRED\n	    e CDATA #IMPLIED\n	    id CDATA #IMPLIED>\n";
